import React from "react";
import {Container} from "react-bootstrap";


function StoreData(){
    return(
        <>
        <Container fluid="md">
            <Row>
                <col><h1>Register New User</h1></col>
            </Row>
        
        </Container>
        
        </>
    )
}

export default StoreData;
